template <typename UnionPtrType> InputPiecePtr InputPiece::Clone() const
{
    switch (tag_) {
    case Tag::kToken:
        return NewToken(mojo::Clone(data_.token));
    case Tag::kText:
        return NewText(mojo::Clone(*data_.text));
    }
    return nullptr;
}

template <typename T, typename std::enable_if<std::is_same<T, InputPiece>::value>::type*> bool InputPiece::Equals(const T& other) const
{
    if (tag_ != other.which())
        return false;

    switch (tag_) {
    case Tag::kToken:
        return mojo::Equals(data_.token, other.data_.token);
    case Tag::kText:
        return mojo::Equals(*(data_.text), *(other.data_.text));
    }

    return false;
}
